import axios from "axios";
import {appConstants} from "../constants/constant";

const API = 'http://localhost:8089';

export const getApplications = () => {
    console.log('send Application Actions');
    const getApplicationsPromise = axios.get(`${API}/applications`, {withCredentials: true});

    console.log(getApplicationsPromise);
    console.log('-------------------------');
    return {
        type: "GET_APPS",
        payload: getApplicationsPromise
    };
};
